import React from 'react';
import {Link} from 'react-router-dom';

import './header.styles.scss';

const Header = () => {
    return(
        <div className="header">
            <Link to="/shop"> shop </Link>  
            <Link to="/signin">Sign In </Link> 
        </div>
    )
}
export default Header
